import React, { useEffect, useState } from "react";
import icon from "../Resimler/Süperlig_logo.png"
import "../Pages/All.css"

const Navbar = () => {

    const [takım,SetTakımlar] =useState([])


    useEffect(() =>{
        const api_link="https://cryptic-gorge-72989.herokuapp.com/teams"
        fetch(api_link)
        .then(takım=>takım.json())
        .then(takım=>{
            SetTakımlar(takım)
        })
    },[])

    return (
        <div>
            <ul class="nav justify-content-center">
                <li class="nav-item">
                    <a class="nav-link active" aria-current="page" href="/">
                        <img src={icon} width="50" />
                    </a>
                </li>
                <li class="nav-item dropdown">
                    <a class="b nav-link dropdown-toggle" style={{ color: "black" }} href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                        Takımlar
                    </a>
                    <ul class="dropdown-menu">
                        <li><a class="dropdown-item" href="#"></a>
                        {
                            takım.map(takım=>
                                <div>
                                    {takım.name}
                                    {takım.name}

                                </div>
                                )
                        }
                        </li>
                    </ul>
                </li>
                <li class="nav-item">
                    <a class="b1 nav-link" style={{ color: "black" }} href="/PuanDurumu">Puan Durumu</a>
                </li>
                <li class="nav-item">
                    <a class="b2 nav-link" style={{ color: "black" }} href="#">Haberler</a>
                </li> <li class="nav-item">
                    <a class="b3 nav-link" style={{ color: "black" }} href="/Profil"><i class="fa-regular fa-user fa-bounce"></i></a>
                </li>
            </ul>
        </div>
    )
}
export default Navbar;
